--[[ Ultra Obfuscated Lua Script ]]
local base64chars = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/'
local function decodeB64(data)
    data = string.gsub(data, '[^'..base64chars..'=]', '')
    return (data:gsub('.', function(x)
        if (x == '=') then return '' end
        local r,f='',(base64chars:find(x)-1)
        for i=6,1,-1 do r=r..(f%2^i-f%2^(i-1)>0 and '1' or '0') end
        return r;
    end):gsub('%d%d%d?%d?%d?%d?%d?%d?%d?', function(x)
        if (#x < 8) then return '' end
        local c=0
        for i=1,8 do c=c+(x:sub(i,i)=='1' and 2^(8-i) or 0) end
        return string.char(c)
    end))
end

local encoded_data = ""
local decoded_script = decodeB64(encoded_data)

-- Chống debug
if debug and debug.getinfo then
    for i = 1, math.huge do
        local info = debug.getinfo(i, "S")
        if not info then break end
        if info.source and (info.source:match("userdata") or info.source:match("C")) then
            error("Debugger detected!", 0)
        end
    end
end

-- Chống Spy
if getgenv then
    local old_env = getgenv()
    setmetatable(_G, { __index = function(_, k)
        if old_env[k] then
            error("Spy detected!", 0)
        end
    end })
end

local fn, err = loadstring(decoded_script)
if fn then
    fn()
else
    print("Error loading script:", err)
end
